import { Typography } from "@material-ui/core";
import React, { useState } from "react";
import "./App.css";
import AStepperForm from "./components/aStepperForm";
import AStepperFormPart from "./components/aStepperFormPart";
import ATextField from "./components/aTextfield";

function App() {
  return (
    <div className="App">
      <AStepperForm>
        <Typography>Personal Particulars</Typography>
        <AStepperFormPart><ATextField name="firstName"/> </AStepperFormPart>
        <AStepperFormPart><ATextField name="lastName"/> </AStepperFormPart>
      </AStepperForm>
      <AStepperForm>
      <Typography>Current Job</Typography>
        <AStepperFormPart><ATextField name="company"/> </AStepperFormPart>
        <AStepperFormPart><ATextField name="jobTitle"/> </AStepperFormPart>
        <AStepperFormPart><ATextField name="role"/> </AStepperFormPart>
      </AStepperForm>
      <AStepperForm>
      <Typography>Questionnaire</Typography>
        <AStepperFormPart><ATextField name="likeCats" label="What do you know about cats? Do you like them? " variant="questionnaire"/> </AStepperFormPart>
        <AStepperFormPart><ATextField label="Do you prefer watching cat videos or dog videos? How much time do you spend on that?" variant="questionnaire"/> </AStepperFormPart>
      </AStepperForm>
    </div>
  );
}

export default App;
